import React from "react";
import Breweries from "../breweries/Breweries";
import Search from "../breweries/Search";
import Filters from "../layout/Filters";

const Home = props => {
  return (
    <div>
      <div className="container">
        <Filters />
        <Search />
        <Breweries />
      </div>
    </div>
  );
};

Home.propTypes = {};

export default Home;
